inline uint32_t disco_Add(uint32_t flowCounter, uint32_t packetSize)
{
	//double tmp1 = (double)(b - 1)*packetSize;
	//double tmp2 = mypow(flowCounter);
	//double delta = mylog(tmp1 + tmp2);
	//double delta = mylog((double)(b - 1)*packetSize + mypow(flowCounter));
	double delta = mylog((double)(b - 1)*packetSize + mypow(flowCounter));
	//float delta = mylog((float)(b - 1)*packetSize + (b-1)*(int)(mypow(flowCounter)/(b-1)+0.5));
	double subDelta = delta - (long)delta;
	double randNum = randf();
	//printf("r %f pkt %d my %f, log %f, ", randNum, packetSize, delta, log((double)(b - 1)*packetSize + mypow(flowCounter))*500.49983349978868);

	if (delta < 1000)
		return (uint32_t)(delta + 0.5);

	if (subDelta == FLT_MIN)
	{
		if (subDelta <= 1 / FLT_MIN)
			return (uint32_t)(delta + 1);
		else
			return (uint32_t)delta;
	}
	else
	{
		if (randNum <= subDelta)
			return (uint32_t)(delta + 1);
		else
			return (uint32_t)delta;
	}
}

inline uint32_t disco_Read(uint32_t flowCounter)
{
	//return (uint32_t)((((mypow(flowCounter)) - 1) / (b - 1)));
	return (uint32_t)((((mypow(flowCounter)) - 1) / (b - 1)) + 0.5);
}

